// src/components/Details.js
import React, { useState } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { searchHouse, filterHouse } from './houseActions';
import Footer from "./components/Footer";
import 'react-responsive-carousel/lib/styles/carousel.min.css';
import HouseSidingRoundedIcon from '@mui/icons-material/HouseSidingRounded';
import './App.css';

function Details() {
  const houseDetails = useSelector(state => state.houses);
  const dispatch = useDispatch();
  const [searchKeyword, setSearchKeyword] = useState('');

  const handleSearch = (e) => {
    setSearchKeyword(e.target.value);
    dispatch(searchHouse(e.target.value));
  }

  const handleFilter = (filterType, filterValue) => {
    const newFilters = { ...houseDetails.filters, [filterType]: filterValue };
    dispatch(filterHouse(newFilters));
  }

  return (
    <div className='home-pg'>
      <nav className="p-4">
        <div className="container mx-auto flex justify-between items-center">
          {/* Left side: Logo */}
          <div className="flex items-center">
            <HouseSidingRoundedIcon />
          </div>

          {/* Middle: Navigation Links */}
          <div className="flex justify-center">
            <span className="text-black font-bold">
              <span className="border-b-2 border-orange-500">Home</span>
            </span>
            <span className="text-black mx-4">Services</span>
            <span className="text-black mx-4">Pricing</span>
            <span className="text-black mx-4">Contact</span>
          </div>

          {/* Right side: Sign Up */}
          <div>
            <button className="text-black font-bold border-2 border-orange-500 px-4 py-2 rounded-full">
              Sign Up
            </button>
          </div>
        </div>
      </nav>
      <div className="container1">
        <div className="search-bar">
          <input type="text" placeholder="Search houses..." value={searchKeyword} onChange={handleSearch} />
        </div>
        <div className="filter-bar">
          <button onClick={() => handleFilter('bedrooms', '2')}>2 Bedrooms</button>
          <button onClick={() => handleFilter('bedrooms', '3')}>3 Bedrooms</button>
          {/* Add more filter buttons as needed */}
        </div>
        <div className="card-container">
          {houseDetails.map((house) => (
            <div className="card1" key={house.id}>
              {/* House details */}
            </div>
          ))}
        </div>
      </div>
      <Footer/>
    </div>
  );
}

export default Details;
